import InfoSection from './InfoSection.js';
import infoSectionTitles from './infoSectionTitles.js';

function Body() {
	const infoSectionComponents = infoSectionTitles.map(title => 
		<InfoSection 
			key={data.id}
			title={data.title}
			text= "filler" 
		/>
	)

	return (
		<div className="body">
			<body> 
				{infoSectionComponents}
			</body>
		</div>
	);
}

export default Body;
